import React from 'react'

function DataTable({ data }) {
    const columns = data[0] && Object.keys(data[0])

    return (
        <div>
            <table cellPadding={20} cellSpacing={10}>
                <thead>
                    <tr>{data[0] && columns.map((heading) => <th>{heading}</th>)}</tr>
                </thead>
                <tbody>
                    {data.map((row) => (
                    <tr>
                        {columns.map((column) => (
                            <tr>{row[column]}</tr>
                        ))}
                    </tr>
                    ))}
                </tbody>
            </table>
        </div>
    )
}

export default DataTable
